# 提取表情包名称和下载链接的函数
def extract_emojis(html_content):
    # 使用正则表达式查找所有包含alt和src的img标签
    matches = re.findall(r'<img[^>]+src="([^"]+)"[^>]+alt="([^"]+)"', html_content)

    # 创建字典存储名称和链接
    emoji_dict = {}
    for match in matches:
        alt_text = match[1].replace("&amp;", "&")
        alt_text = alt_text.replace("_", " ")
        alt_text = alt_text.replace(" ", "-")
        src_link = match[0]
        alt_text = alt_text + '.' + src_link.split(".")[-1]
        emoji_dict[alt_text] = src_link

    return emoji_dict


emoji_dict = extract_emojis(html_content)
for name, link in emoji_dict.items():
    print(f"Name: {name}, Link: {link}")
    # download
    response = requests.get(link)
    with open(f"emoji/星穹铁道/{name}", "wb") as f:
        f.write(response.content)
